_CODE_EXAMPLES.map:
// _.map(list, iteratee)
_.map([1, 2, 3], function(n){ return n * 3; });
// => [3, 6, 9]
_.map({one: 1, two: 2, three: 3}, (v, k) => v + k.length);
// => [4, 5, 8]

_CODE_EXAMPLES.reduce:
// _.reduce(list, iteratee, [memo])
_.reduce([1, 2, 3], function(memo, n){ return memo + n; }, 0);
// => 6

_CODE_EXAMPLES.max:
// _.max(list, [iteratee])
_.max([{name: 'moe', age: 40}, {name: 'larry', age: 50}], function(o){ return o.age; });
// => {name: 'larry', age: 50}

_CODE_EXAMPLES.mapObject:
// _.mapObject(object, iteratee)
_.mapObject({a: 1, b: 2}, function(v){ return v * 2; });
// => {a: 2, b: 4}

_CODE_EXAMPLES.clone:
// _.clone(object)
var stooge = {name: 'moe'};
var clone = _.clone(stooge);
clone === stooge; // => false

_CODE_EXAMPLES.toPath:
// _.toPath(path)
_.toPath('a.b[0]');
// => ['a.b[0]'] in Underscore (string is not parsed like lodash)

_CODE_EXAMPLES.matcher:
// _.matcher(attrs)
var isTeen = _.matcher({teen: true});
isTeen({name: 'Alex', teen: true});
// => true
